import useEliminarRestriccion from '../hooks/useEliminarRestriccion';


export const BotonElimnar = (props) => {
    const restriccion = props.datosRestriccion;

    return (
        <button onClick={useEliminarRestriccion(restriccion.id)}>{props.texto}</button>
    )
}

export default BotonElimnar;
